import React from 'react';
import Badge from '../components/Badge';
import BadgeProfile from '../components/BadgeProfile'
import Tweet from '../components/Tweet'
import BadgeList from '../components/BadgesList'

class BadgeNew extends React.Component {
    state={
        data:[
            {
                username:'Alvaro'
            },
            {
                username:'Jorge'
            },
            {
                username:'Arnoldo'
            }
        ]
    }
	render() {
		return (
			<div className="container ">
				<div className="row">
					<div className="col-4">
						<div className="row">

							<BadgeProfile/>
						</div>
                        <div className="row">
                            <Badge/>
                        </div>
					</div>
					<div className="col-sm-8">
                        <BadgeList tweets={this.state.data}/>
					</div>
				</div>
			</div>
		);
	}
}

export default BadgeNew;
